import * as fs from "fs";
import * as path from "path";
import { fileURLToPath } from "url";

export class MuSeReportGenerator {
	constructor() {
		this.logFilePath = path.join("/app/MuSe/sumo/results/sumo-log.txt");
		this.outputDir = path.join("/app/MuSe/sumo/results/");
		this.reportData = {};
	}

	// Parsea il file di log per estrarre i dati
	parseLogFile() {
		try {
			const logContent = fs.readFileSync(this.logFilePath, "utf8");

			// Estrai contract path
			const contractMatch = logContent.match(/Contracts to be mutated.*?:\s*\(1\):\s*-\s*(.+)/);
			const contractPath = contractMatch ? contractMatch[1].trim() : "";
			const contractName = path.basename(contractPath);

			// Estrai test file path
			const testMatch = logContent.match(/Tests to be run.*?:\s*\(1\):\s*-\s*(.+)/);
			const testPath = testMatch ? testMatch[1].trim() : "";
			const testFile = path.basename(testPath);

			// Estrai numero totale di mutanti
			const totalMutantsMatch = logContent.match(/(\d+) mutation\(s\) found in ([\d.]+) seconds/);
			const totalMutants = totalMutantsMatch ? parseInt(totalMutantsMatch[1]) : 0;
			const generationTime = totalMutantsMatch ? totalMutantsMatch[2] : "0";

			// Estrai mutanti testati
			const testedMutantsMatch = logContent.match(/- Tested mutants: (\d+)/);
			const testedMutants = testedMutantsMatch ? parseInt(testedMutantsMatch[1]) : 0;

			// Estrai mutanti vivi
			const liveMutantsMatch = logContent.match(/- Live mutants: (\d+)\s+--- Live: "([^"]+)"/);
			const liveMutantsCount = liveMutantsMatch ? parseInt(liveMutantsMatch[1]) : 0;
			const liveMutantsList = liveMutantsMatch ? liveMutantsMatch[2].split(", ").map((m) => m.trim()) : [];

			// Estrai mutanti uccisi
			const killedMutantsMatch = logContent.match(/- Killed mutants: (\d+)\s+--- Killed: "([^"]+)"/);
			const killedMutantsCount = killedMutantsMatch ? parseInt(killedMutantsMatch[1]) : 0;
			const killedMutantsList = killedMutantsMatch ? killedMutantsMatch[2].split(", ").map((m) => m.trim()) : [];

			// Estrai mutation score
			const scoreMatch = logContent.match(/MUTATION SCORE = ([\d.]+)/);
			const mutationScore = scoreMatch ? parseFloat(scoreMatch[1]) : 0;

			// Estrai durata
			const durationMatch = logContent.match(/(\d+) mutant\(s\) tested in ([\d.]+) minutes/);
			const duration = durationMatch ? durationMatch[2] : "0";

			const mutantDetailsPattern = /Mutant (\w+) was generated by (\w+)/g;
			const mutantDetails = {};
			let match;
			while ((match = mutantDetailsPattern.exec(logContent)) !== null) {
				mutantDetails[match[1]] = match[2]; // mutantId -> mutationType
			}

			this.reportData = {
				contractName,
				contractPath,
				testFile,
				testPath,
				totalMutants,
				testedMutants,
				liveMutantsCount,
				killedMutantsCount,
				mutationScore,
				duration,
				generationTime,
				liveMutantsList,
				killedMutantsList,
				mutantDetails,
			};

			return this.reportData;
		} catch (error) {
			console.error("Errore nel parsing del log file:", error);
			return null;
		}
	}

	// Genera il template HTML
	generateHTMLTemplate() {
		return `<!DOCTYPE html>
<html lang="it">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>MuSe Testing Report</title>
    <style>
        * {
            margin: 0;
            padding: 0;
            box-sizing: border-box;
        }
        
        body {
            font-family: 'Segoe UI', Tahoma, Geneva, Verdana, sans-serif;
            background: linear-gradient(135deg, #667eea 0%, #764ba2 100%);
            min-height: 100vh;
            padding: 20px;
        }
        
        .container {
            max-width: 1200px;
            margin: 0 auto;
            background: white;
            border-radius: 15px;
            box-shadow: 0 20px 40px rgba(0,0,0,0.1);
            overflow: hidden;
        }
        
        .header {
            background: linear-gradient(135deg, #1e3c72 0%, #2a5298 100%);
            color: white;
            padding: 30px;
            text-align: center;
        }
        
        .logo {
            width: 280px; /* Aumentata la larghezza per un formato rettangolare */
            height: 120px;
            margin: 0 auto 20px;
            background: rgba(255,255,255,0.1);
            border-radius: 10px; /* Cambiato da 50% a 10px per angoli arrotondati rettangolari */
            display: flex;
            align-items: center;
            justify-content: center;
            font-size: 36px;
            font-weight: bold;
            overflow: hidden; /* Per contenere l'immagine */
        }

        .logo img {
            width: 100%;
            height: 100%;
            object-fit: contain; /* Cambiato da cover a contain per mantenere le proporzioni */
            border-radius: 10px; /* Stesso border-radius del contenitore */
        }
        .header h1 {
            font-size: 2.5em;
            margin-bottom: 10px;
            text-shadow: 2px 2px 4px rgba(0,0,0,0.3);
        }
        
        .subtitle {
            opacity: 0.9;
            font-size: 1.1em;
        }
        
        .summary {
            padding: 40px;
            background: #f8f9fc;
        }
        
        .info-grid {
            display: grid;
            grid-template-columns: repeat(auto-fit, minmax(250px, 1fr));
            gap: 20px;
            margin-bottom: 30px;
        }
        
        .info-card {
            background: white;
            padding: 20px;
            border-radius: 10px;
            box-shadow: 0 4px 6px rgba(0,0,0,0.07);
            border-left: 4px solid #667eea;
        }
        
        .info-card h3 {
            color: #2d3748;
            margin-bottom: 8px;
            font-size: 0.9em;
            text-transform: uppercase;
            letter-spacing: 0.5px;
        }
        
         .info-card .value {
            font-size: 1.8em;
            font-weight: bold;
            color: #1a202c;
            overflow: hidden; /* Keeps the text within the container */
            word-wrap: break-word; /* Allows breaking long words */
            word-break: break-word; /* Ensures proper word breaking */
        }
        
        .stats-grid {
            display: grid;
            grid-template-columns: repeat(auto-fit, minmax(200px, 1fr));
            gap: 20px;
            margin-bottom: 30px;
        }
        
        .stat-card {
            background: white;
            padding: 25px;
            border-radius: 10px;
            text-align: center;
            box-shadow: 0 4px 6px rgba(0,0,0,0.07);
            cursor: pointer;
            transition: all 0.3s ease;
            position: relative;
            overflow: hidden;
        }
        
        .stat-card::before {
            content: '';
            position: absolute;
            top: 0;
            left: 0;
            right: 0;
            height: 4px;
            background: linear-gradient(90deg, #667eea, #764ba2);
        }
        
        .stat-card:hover {
            transform: translateY(-2px);
            box-shadow: 0 8px 20px rgba(0,0,0,0.15);
        }
        
        .stat-card.live::before {
            background: linear-gradient(90deg, #e53e3e, #fc8181);
        }
        
        .stat-card.killed::before {
            background: linear-gradient(90deg, #38a169, #68d391);
        }
        
        .stat-card.score::before {
            background: linear-gradient(90deg, #3182ce, #63b3ed);
        }
        
        .stat-number {
            font-size: 3em;
            font-weight: bold;
            margin-bottom: 10px;
        }
        
        .stat-card.live .stat-number {
            color: #e53e3e;
        }
        
        .stat-card.killed .stat-number {
            color: #38a169;
        }
        
        .stat-card.score .stat-number {
            color: #3182ce;
        }
        
        .stat-label {
            font-size: 0.9em;
            text-transform: uppercase;
            letter-spacing: 0.5px;
            color: #718096;
            font-weight: 600;
        }
        
        .mutants-section {
            padding: 40px;
            background: white;
        }
        
        .section-title {
            font-size: 1.8em;
            color: #2d3748;
            margin-bottom: 25px;
            display: flex;
            align-items: center;
        }
        
        .section-title::before {
            content: '';
            width: 4px;
            height: 30px;
            background: linear-gradient(135deg, #667eea, #764ba2);
            margin-right: 15px;
            border-radius: 2px;
        }
        
        .mutants-container {
            display: none;
            margin-top: 20px;
        }
        
        .mutants-container.active {
            display: block;
            animation: fadeIn 0.3s ease;
        }
        
        @keyframes fadeIn {
            from { opacity: 0; transform: translateY(10px); }
            to { opacity: 1; transform: translateY(0); }
        }
        
        .mutants-grid {
            display: grid;
            grid-template-columns: repeat(auto-fill, minmax(150px, 1fr));
            gap: 15px;
            margin-bottom: 20px;
        }
        
        .mutant-item {
            background: #f7fafc;
            padding: 15px;
            border-radius: 8px;
            text-align: center;
            transition: all 0.3s ease;
            border: 2px solid transparent;
            font-family: 'Courier New', monospace;
            font-size: 1.5em;
        }
        
        .mutant-item.live {
            border-left: 4px solid #e53e3e;
        }
        
        .mutant-item.killed {
            border-left: 4px solid #38a169;
        }
        
        .footer {
            background: #f8f9fc;
            padding: 20px;
            text-align: center;
            color: #718096;
            font-size: 0.9em;
        }
        
        .timestamp {
            position: absolute;
            top: 10px;
            right: 20px;
            font-size: 0.8em;
            opacity: 0.7;
        }
    </style>
</head>
<body>
    <div class="container">
        <div class="header">
            <div class="timestamp">Generated: {{TIMESTAMP}}</div>
            <div class="logo">
            <img src="data:image/png;base64,
" alt="Logo" style="width: 100%; height: 100%; object-fit: cover;">
            </div>
            <h1>MuSe Testing Report</h1>
            <div class="subtitle">Mutation Testing Results for Smart Contracts</div>
        </div>
        
        <div class="summary">
            <div class="info-grid">
                <div class="info-card">
                    <h3>Contract Under Test</h3>
                    <div class="value">{{CONTRACT_NAME}}</div>
                </div>
                <div class="info-card">
                    <h3>Test File</h3>
                    <div class="value">{{TEST_FILE}}</div>
                </div>
                <div class="info-card">
                    <h3>Testing Duration</h3>
                    <div class="value">{{DURATION}} minutes</div>
                </div>
                <div class="info-card">
                    <h3>Mutant Generation Time</h3>
                    <div class="value">{{GENERATION_TIME}} seconds</div>
                </div>
            </div>
            
            <div class="stats-grid">
                <div class="stat-card" onclick="showMutants('generated')">
                    <div class="stat-number">{{TOTAL_MUTANTS}}</div>
                    <div class="stat-label">Generated Mutants</div>
                </div>
                <div class="stat-card live" onclick="showMutants('live')">
                    <div class="stat-number">{{LIVE_MUTANTS}}</div>
                    <div class="stat-label">Live Mutants</div>
                </div>
                <div class="stat-card killed" onclick="showMutants('killed')">
                    <div class="stat-number">{{KILLED_MUTANTS}}</div>
                    <div class="stat-label">Killed Mutants</div>
                </div>
                <div class="stat-card score">
                    <div class="stat-number">{{MUTATION_SCORE}}%</div>
                    <div class="stat-label">Mutation Score</div>
                </div>
            </div>
        </div>
        
        <div class="mutants-section">
            <div id="liveMutantsSection" class="mutants-container">
                <div class="section-title">Live Mutants (Test Suite Needs Improvement)</div>
                <div class="mutants-grid" id="liveMutantsGrid"></div>
            </div>
            
            <div id="killedMutantsSection" class="mutants-container">
                <div class="section-title">Killed Mutants (Well Tested)</div>
                <div class="mutants-grid" id="killedMutantsGrid"></div>
            </div>
            
            <div id="generatedMutantsSection" class="mutants-container">
                <div class="section-title">All Generated Mutants</div>
                <div class="mutants-grid" id="generatedMutantsGrid"></div>
            </div>
        </div>
        
        <div class="footer">
            Generated by MuSe - Mutation Testing Tool for Solidity Smart Contracts
        </div>
    </div>
    
    <script>
        const reportData = {{REPORT_DATA}};
        let currentSection = null;
        
        function showMutants(type) {
            document.querySelectorAll('.mutants-container').forEach(section => {
                section.classList.remove('active');
            });
            
            let sectionId, mutantsList, cssClass;
            
            switch(type) {
                case 'live':
                    sectionId = 'liveMutantsSection';
                    mutantsList = reportData.liveMutantsList;
                    cssClass = 'live';
                    break;
                case 'killed':
                    sectionId = 'killedMutantsSection';
                    mutantsList = reportData.killedMutantsList;
                    cssClass = 'killed';
                    break;
                case 'generated':
                    sectionId = 'generatedMutantsSection';
                    mutantsList = [...reportData.liveMutantsList, ...reportData.killedMutantsList];
                    cssClass = 'generated';
                    break;
            }
            
            const section = document.getElementById(sectionId);
            const grid = section.querySelector('.mutants-grid');
            
            if (grid.children.length === 0) {
                mutantsList.forEach(mutantId => {
                    const mutantDiv = document.createElement('div');
                    mutantDiv.className = \`mutant-item \${reportData.liveMutantsList.includes(mutantId) ? 'live' : 'killed'}\`;
                    const mutationType = reportData.mutantDetails[mutantId] || 'Unknown';
                    mutantDiv.innerHTML = \`
            <div style = "font-weight: bold;" >\${mutantId} </div>
        <div style="font-size: 0.75em; color: #666; margin-top: 4px;">(\${mutationType})</div>\`;
                    grid.appendChild(mutantDiv);
                });
            }
            
            section.classList.add('active');
            currentSection = type;
        }
        
        window.onload = function() {
            showMutants('live');
        }
    </script>
</body>
</html>`;
	}

	// Genera il report HTML
	generateReport() {
		try {
			// Parsa il file di log
			const data = this.parseLogFile();
			if (!data) {
				throw new Error("Impossibile parsare il file di log");
			}

			// Crea la directory di output se non esiste
			if (!fs.existsSync(this.outputDir)) {
				fs.mkdirSync(this.outputDir, { recursive: true });
			}

			// Genera il template HTML
			let htmlTemplate = this.generateHTMLTemplate();

			// Sostituisci i placeholder con i dati reali
			const timestamp = new Date().toLocaleString();
			htmlTemplate = htmlTemplate
				.replace("{{TIMESTAMP}}", timestamp)
				.replace("{{CONTRACT_NAME}}", data.contractName)
				.replace("{{TEST_FILE}}", data.testFile)
				.replace("{{DURATION}}", data.duration)
				.replace("{{GENERATION_TIME}}", data.generationTime)
				.replace("{{TOTAL_MUTANTS}}", data.totalMutants)
				.replace("{{LIVE_MUTANTS}}", data.liveMutantsCount)
				.replace("{{KILLED_MUTANTS}}", data.killedMutantsCount)
				.replace("{{MUTATION_SCORE}}", data.mutationScore)
				.replace("{{REPORT_DATA}}", JSON.stringify(data));

			// Salva il report
			const reportPath = path.join(this.outputDir, "muse-report.html");
			fs.writeFileSync(reportPath, htmlTemplate, "utf8");

			return reportPath;
		} catch (error) {
			console.error("Errore nella generazione del report:", error);
			throw error;
		}
	}
}
